import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the "Your Profile" link to navigate to the profile section
    // Using getByRole for a more robust, user-facing selector
    await page.getByRole('link', { name: 'Your Profile' }).first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_clicked_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_clicked_profile.png'));

    // Wait for the profile header to be visible
    await page.waitForSelector('.profile-header', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();
    const bio = await page.locator('.profile-info .bio').textContent();

    // Extract profile stats
    const stats = {};
    const statElements = await page.locator('.stat').all();
    for (const statElement of statElements) {
      const label = await statElement.locator('.stat-label').textContent();
      const number = await statElement.locator('.stat-number').textContent();
      if (label && number) {
        stats[label.trim()] = number.trim();
      }
    }

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      stats: stats
    };

    return {
      success: true,
      action: "Successfully harvested user profile information.",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
